    {
        static void Main(string[] args)
        {
            Console.Write("Введите выражение: ");
            string userExpress = Console.ReadLine();

            int allowDeepExpress = 1;
            int currentDeepExpress = 1;
            int maxDeepExpress = 1;

            bool incorrectExpression = false;

            for (int i = 0; i < userExpress.Length; i++)
            {

                if (userExpress[i] == '(')
                {
                    currentDeepExpress++;
                }
                else
                {
                    currentDeepExpress--;

                    if (currentDeepExpress > maxDeepExpress)
                    {
                        maxDeepExpress = currentDeepExpress;
                    }

                    if (currentDeepExpress < allowDeepExpress)
                    {
                        incorrectExpression = true;
                        break;
                    }

                }
            }

            if (incorrectExpression || currentDeepExpress > 1)
            {
                Console.WriteLine("Выражение не верно");
            }
            else
            {
                Console.WriteLine($"Выражение верно.\nМаксимальная глубина составляет - {maxDeepExpress}.");
            }

            Console.ReadLine();
        }
    }
}

