namespace Dicktionary
{
    internal class Program
    {
        static void Main(string[] args)
        {
            string userInput = string.Empty;
            string commandExit = "exit";

            string requestWord = "Введите слово, значение которого требуется найти:";
            string errorMessage = "Слово не найдено.";
            string shutdownMessage = "Завершение работы...";

            Dictionary<string, string> dictionary = new Dictionary<string, string>();

            dictionary.Add("Водка", "любимый напиток отечественного программиста.");
            dictionary.Add("Певандрий", "разговорная форма от слова 'Пиво' в орфографическом контексте жаргона падонков.");
            dictionary.Add("Конина", "лошадиное мясо.");
            dictionary.Add("Турбореализм", "самоназвание направления, возникшего в российской фантастической литературе в начале 1990-х годов.");

            while (userInput != commandExit)
            {
                Console.WriteLine(requestWord);
                userInput = Console.ReadLine();

                if (dictionary.ContainsKey(userInput))
                {
                    Console.WriteLine(userInput + " - " + dictionary[userInput]);
                }
                else
                {
                    Console.WriteLine(errorMessage);
                }
            }

            Console.WriteLine(shutdownMessage);
            Console.ReadLine();
        }
    }
}

