#include <iostream>

using namespace std;

int main() {

    setlocale(LC_ALL, "ru");

    int a = 10;
    int b = 3;

    cout << a + b << endl; // сложение
    cout << a - b << endl; // вычитание
    cout << a * b << endl; // умножение
    cout << a / b << endl; // деление
    cout << a % b << endl; // деление по модулю (получение остатка от деления)
    cout << -a << endl; // унарный минус
    a++; // инкремент (увеличивает значение на 1)
    cout << a << endl; 
    a--; // декремент (уменьшает значение на 1)
    cout << a << endl; // 10


    
    cout << a++ << endl; // 11 (при постфиксной форме записи сначала выполняется операция (вывод в поток в данном случае), потом значение переменной увеличивается)

    cout << a << endl; // 11

    cout << ++a << endl; // 12 (при префиксной форме записи сначала  значение переменной увеличивается, потом выполняется операция (в данном случае вывод в поток))

    cout << a << endl; // 12

    a = a + 3; // изменили значение переменной а (увеличили на 3)
    cout << a << endl;

    a += 3; // равносильно  a = a + 3
    cout << a << endl;

    a -= 3; // равносильно  a = a - 3
    cout << a << endl;

    a *= 3; // равносильно  a = a * 3
    cout << a << endl;

    a /= 3; // равносильно  a = a / 3
    cout << a << endl;

    a %= 3; // равносильно  a = a + 3
    cout << a << endl;
}

