/* --- with minimal parameters per face */

list face_adj = [
    // face, rot
    2, 90,      // hours
    0, 180,     // minutes
    4, 270      // seconds
];

list setFrame(integer base, integer i)
{
    base *= 2;
    vector offs = <0.0625 * ((i % 8) * 2 + 1) - 0.5,
            0.0625 * ((7 - llFloor(i / 8)) * 2 + 1) - 0.5, 0>;
    return [PRIM_TEXTURE, llList2Integer(face_adj, base), digits,
            <0.125, 0.125, 0>, offs + <-0.015,0,0>,
            llList2Float(face_adj, base+1) * DEG_TO_RAD];
}

