integer oldhours = -1;
integer oldminutes = -1;
integer oldseconds = -1;

default
{
    state_entry()
    {
        llSetTimerEvent(1);
    }

    timer()
    {
        integer clock = (integer)llGetWallclock() - 1;
        
        integer hours = clock / 3600;
        integer minutes = (clock % 3600) / 60;
        integer seconds = clock % 60;
        
        //hours = minutes = seconds = 0;
        
        list update;

        if (hours != oldhours)
        {
            update += setFrame(0, hours);
            oldhours = hours;
        }
        
        if (minutes != oldminutes)
        {
            update += setFrame(1, minutes);
            oldminutes = minutes;
        }
        
        if (seconds != oldseconds)
        {
            update += setFrame(2, seconds);
            oldseconds = seconds;
        }
        
        llSetLinkPrimitiveParams(2, update);
    }
}
